            int replacement = binarySearch(sortedNums1, nums2[i]);
            int newDiff = Math.abs(replacement - nums2[i]);
            int reduction = diff - newDiff;
            if (reduction > 0) {
                maxReduction = Math.max(maxReduction, reduction);
            }
        }

        return (sum - maxReduction + mod) % mod;
    }

    private int binarySearch(int[] arr, int target) {
        int left = 0;
        int right = arr.length - 1;
        int closest = arr[0];

        while (left <= right) {
            int mid = left + (right - left) / 2;
            if (arr[mid] == target) {
                return arr[mid];
            } else if (arr[mid] < target) {
                left = mid + 1;
                closest = arr[mid];
            } else {
