public class Solution {
    public boolean findRotation(int[][] mat, int[][] target) {
        int n = mat.length;
        if (n != target.length) {
            return false;
        }

        // Check if mat is equal to target
        if (Arrays.deepEquals(mat, target)) {
            return true;
        }

        // Rotate mat 90 degrees
