        if (Arrays.deepEquals(rotatedMat, target)) {
            return true;
        }

        // Rotate mat 180 degrees
        rotatedMat = rotate(rotatedMat);
        if (Arrays.deepEquals(rotatedMat, target)) {
            return true;
        }

        // Rotate mat 270 degrees
        rotatedMat = rotate(rotatedMat);
        if (Arrays.deepEquals(rotatedMat, target)) {
            return true;
        }

        return false;
    }

    private int[][] rotate(int[][] mat) {
        int n = mat.length;
        int[][] rotatedMat = new int[n][n];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                rotatedMat[j][n - 1 - i] = mat[i][j];
            }
        }
        return rotatedMat;
    }
