public class Solution {
    public boolean canReach(String s, int minJump, int maxJump) {
        int n = s.length();
        if (n == 0) {
            return false;
        }
        if (s.charAt(n - 1) == '1') {
            return false;
        }

        Queue<Integer> queue = new LinkedList<>();
        queue.offer(0);
        boolean[] visited = new boolean[n];
        visited[0] = true;

        while (!queue.isEmpty()) {
            int current = queue.poll();

            if (current == n - 1) {
                return true;
            }

            for (int i = current + minJump; i <= Math.min(current + maxJump, n - 1); i++) {
                if (s.charAt(i) == '0' && !visited[i]) {
                    queue.offer(i);
                    visited[i] = true;
                }
            }
        }

        return false;
    }
}

