    public boolean isCovered(int[][] ranges, int left, int right) {
        boolean[] covered = new boolean[right - left + 1];
        for (int[] range : ranges) {
            int start = range[0];
            int end = range[1];
            for (int i = Math.max(left, start); i <= Math.min(right, end); i++) {
                covered[i - left] = true;
