public class Solution {
    public int[] assignTasks(int[] servers, int[] tasks) {
        int n = servers.length;
        int m = tasks.length;
        int[] ans = new int[m];
        PriorityQueue<int[]> availableServers = new PriorityQueue<>((a, b) -> {
            if (a[0] != b[0]) {
                return a[0] - b[0];
            }
            return a[1] - b[1];
        });
        for (int i = 0; i < n; i++) {
            availableServers.offer(new int[]{servers[i], i});
        }
        List<int[]> busyServers = new ArrayList<>();
        for (int j = 0; j < m; j++) {
            while (busyServers.size() > 0 && busyServers.get(0)[0] <= j) {
                int[] server = busyServers.remove(0);
                availableServers.offer(new int[]{servers[server[1]], server[1]});
            }
            if (availableServers.isEmpty()) {
                int nextAvailableTime = busyServers.get(0)[0];
                j = nextAvailableTime - 1;
                continue;
            }
            int[] server = availableServers.poll();
            ans[j] = server[1];
            busyServers.add(new int[]{j + tasks[j], server[1]});
            busyServers.sort((a, b) -> a[0] - b[0]);
        }
        return ans;
    }
}

