    public int largestMagicSquare(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        int maxSide = Math.min(m, n);

        for (int side = maxSide; side >= 1; side--) {
            for (int i = 0; i <= m - side; i++) {
                for (int j = 0; j <= n - side; j++) {
                    if (isMagicSquare(grid, i, j, side)) {
                        return side;
                    }
                }
            }
        }

        return 1;
    }

    private boolean isMagicSquare(int[][] grid, int rowStart, int colStart, int side) {
        int sum = 0;
        for (int i = colStart; i < colStart + side; i++) {
            sum += grid[rowStart][i];
        }

        // Check rows
        for (int i = rowStart + 1; i < rowStart + side; i++) {
            int rowSum = 0;
            for (int j = colStart; j < colStart + side; j++) {
                rowSum += grid[i][j];
            }
            if (rowSum != sum) {
                return false;
            }
        }

        // Check columns
        for (int j = colStart + 1; j < colStart + side; j++) {
            int colSum = 0;
            for (int i = rowStart; i < rowStart + side; i++) {
                colSum += grid[i][j];
            }
            if (colSum != sum) {
                return false;
            }
        }

        // Check main diagonal
        int mainDiagonalSum = 0;
        for (int i = 0; i < side; i++) {
            mainDiagonalSum += grid[rowStart + i][colStart + i];
        }
        if (mainDiagonalSum != sum) {
            return false;
        }

        // Check anti-diagonal
        int antiDiagonalSum = 0;
        for (int i = 0; i < side; i++) {
            antiDiagonalSum += grid[rowStart + i][colStart + side - 1 - i];
        }
        if (antiDiagonalSum != sum) {
            return false;
        }

        return true;
    }
}

