public class Solution {
    public int reinitializePermutation(int n) {
        if (n == 1) {
            return 0;
        }
        int[] perm = new int[n];
        for (int i = 0; i < n; i++) {
            perm[i] = i;
        }

        int[] currentPerm = perm.clone();
        int operations = 0;

        while (true) {
            int[] nextPerm = new int[n];
            for (int i = 0; i < n; i++) {
                if (i % 2 == 0) {
                    nextPerm[i] = currentPerm[i / 2];
                } else {
                    nextPerm[i] = currentPerm[n / 2 + (i - 1) / 2];
                }
            }

            operations++;
            boolean equal = true;
            for (int i = 0; i < n; i++) {
                if (nextPerm[i] != perm[i]) {
                    equal = false;
                    break;
                }
            }

            if (equal) {
                return operations;
            }

            currentPerm = nextPerm.clone();
        }
    }
}

