public class Solution {
    public int maximumRemovals(String s, String p, int[] removable) {
        int left = 0;
        int right = removable.length;
        int ans = 0;

        while (left <= right) {
            int mid = (left + right) / 2;
            if (isSubsequence(s, p, removable, mid)) {
                ans = mid;
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }

        return ans;
    }

    private boolean isSubsequence(String s, String p, int[] removable, int k) {
        StringBuilder sb = new StringBuilder(s);
        for (int i = 0; i < k; i++) {
            sb.setCharAt(removable[i], '*');
        }

        String modifiedS = sb.toString();
        int i = 0;
        int j = 0;

        while (i < modifiedS.length() && j < p.length()) {
            if (modifiedS.charAt(i) == p.charAt(j) && modifiedS.charAt(i) != '*') {
                j++;
            }
            i++;
        }

        return j == p.length();
    }
}

