public class Solution {
    public int[] getMaximumXor(int[] nums, int maximumBit) {
        int n = nums.length;
        int[] answer = new int[n];
        int currentXor = 0;
        for (int i = 0; i < n; i++) {
            currentXor ^= nums[i];
        }
        for (int i = n - 1; i >= 0; i--) {
            int k = 0;
            for (int j = maximumBit - 1; j >= 0; j--) {
                int mask = 1 << j;
                if ((currentXor & mask) == 0) {
                    k |= mask;
                }
            }
            answer[i] = k;
            currentXor ^= nums[i];
        }
        return answer;
    }
}

