public class Solution {
    public int minSideJumps(int[] obstacles) {
        int n = obstacles.length;
        int[] dp = new int[3];
        dp[1] = 0;
        dp[0] = Integer.MAX_VALUE;
        dp[2] = Integer.MAX_VALUE;

        for (int i = 1; i < n; i++) {
            int obstacle = obstacles[i];
            int[] newDp = new int[3];
            for (int lane = 0; lane < 3; lane++) {
                if (obstacle == lane + 1) {
                    newDp[lane] = Integer.MAX_VALUE;
                } else {
                    newDp[lane] = Math.min(dp[lane], dp[(lane + 1) % 3] + 1);
                    newDp[lane] = Math.min(newDp[lane], dp[(lane + 2) % 3] + 1);
                }
            }
            dp = newDp;
        }

        int minJumps = Math.min(dp[0], Math.min(dp[1], dp[2]));
        return minJumps;
    }
}

