// #Medium #String #Backtracking #2022_05_08_Time_1_ms_(87.61%)_Space_41.9_MB_(68.80%)
public class Solution {
    public boolean splitString(String s) {
        if (s == null || s.length() == 0) {
            return false;
        }

        return backtrack(s, 0, Long.MAX_VALUE, 0);
    }

    private boolean backtrack(String s, int start, long prev, int count) {
        if (start == s.length()) {
            return count >= 2;
        }

        for (int i = start; i < s.length(); i++) {
            if (s.charAt(start) == '0' && i > start) {
                continue;
            }

            long current = Long.parseLong(s.substring(start, i + 1));

            if (count == 0 || current < prev && prev - current == 1) {
                if (backtrack(s, i + 1, current, count + 1)) {
                    return true;
                }
            }
        }

        return false;
    }
}

