import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashMap;
import java.util.List;
public class Solution {
    public int largestPathValue(String colors, int[][] edges) {
        int n = colors.length();
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        int[] inDegree = new int[n];
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            inDegree[v]++;
        }

        int[][] dp = new int[n][26];
        List<Integer> q = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            if (inDegree[i] == 0) {
                q.add(i);
            }
        }

        int count = 0;
        int maxVal = 0;
        while (!q.isEmpty()) {
            int u = q.remove(0);
            count++;
            int colorIndex = colors.charAt(u) - 'a';
            dp[u][colorIndex] = 1;
            maxVal = Math.max(maxVal, dp[u][colorIndex]);

            for (int v : adj.get(u)) {
                for (int i = 0; i < 26; i++) {
                    dp[v][i] = Math.max(dp[v][i], dp[u][i] + (colors.charAt(v) - 'a' == i ? 1 : 0));
                }
                maxVal = Math.max(maxVal, dp[v][colors.charAt(v) - 'a']);
                inDegree[v]--;
                if (inDegree[v] == 0) {
                    q.add(v);
                }
            }
        }

        if (count != n) {
            return -1;
        }

        int result = 0;
        for (int i = 0; i < n; i++) {
            int maxCount = 0;
            for (int j = 0; j < 26; j++) {
                maxCount = Math.max(maxCount, dp[i][j]);
            }
            result = Math.max(result, maxCount);
        }

        return result;
    }
}

