public class Solution {
    public boolean splitArraySameAverage(int[] nums) {
        int n = nums.length;
        if (n <= 1) {
            return false;
        }

        double sum = 0;
        for (int num : nums) {
            sum += num;
        }

        for (int i = 1; i < n; i++) {
            if ((sum * i) % n == 0) {
                int targetSum = (int) ((sum * i) / n);
                if (canPartition(nums, i, targetSum)) {
                    return true;
                }
            }
        }

        return false;
    }

    private boolean canPartition(int[] nums, int k, int targetSum) {
        int n = nums.length;
        boolean[][] dp = new boolean[n + 1][targetSum + 1];
        dp[0][0] = true;

        for (int i = 1; i <= n; i++) {
            for (int j = 0; j <= targetSum; j++) {
                dp[i][j] = dp[i - 1][j];
                if (j >= nums[i - 1]) {
                    dp[i][j] = dp[i][j] || dp[i - 1][j - nums[i - 1]];
                }
            }
        }

        return dp[n][targetSum];
    }
}

