public class Solution {
    public int[] loudAndRich(int[][] richer, int[] quiet) {
        int n = quiet.length;
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : richer) {
            adj.get(edge[1]).add(edge[0]);
        }

        int[] answer = new int[n];
        Arrays.fill(answer, -1);

        for (int i = 0; i < n; i++) {
            dfs(i, adj, quiet, answer);
        }

        return answer;
    }

    private int dfs(int node, List<List<Integer>> adj, int[] quiet, int[] answer) {
        if (answer[node] != -1) {
            return answer[node];
        }

        int minQuiet = node;
        for (int neighbor : adj.get(node)) {
            int neighborMinQuiet = dfs(neighbor, adj, quiet, answer);
            if (quiet[neighborMinQuiet] < quiet[minQuiet]) {
                minQuiet = neighborMinQuiet;
            }
        }

        answer[node] = minQuiet;
        return minQuiet;
    }
}

