            }

            // Option 2: Reverse
            int newSpeedR = speed > 0 ? -1 : 1;
            String stateR = position + "," + newSpeedR;
            if (Math.abs(position - target) < 2 * target && !visited.contains(stateR)) {
                queue.offer(new int[]{position, newSpeedR, steps + 1});
                visited.add(stateR);
            }
        }

        return -1; // Should not happen
