public class Solution {
    public int flipgame(int[] fronts, int[] backs) {
        Set<Integer> used = new HashSet<>();
        for (int back : backs) {
            used.add(back);
        }

        int first = -1;
        for (int front : fronts) {
            if (!used.contains(front)) {
                first = front;
                break;
