import com_github_leetcode.TreeNode;
import java.util.HashMap;

public class Solution {
    public TreeNode constructFromPrePost(int[] preorder, int[] postorder) {
        HashMap<Integer, Integer> postorderIndexMap = new HashMap<>();
        for (int i = 0; i < postorder.length; i++) {
            postorderIndexMap.put(postorder[i], i);
        }
        return buildTree(preorder, postorder, 0, preorder.length - 1, 0, postorder.length - 1, postorderIndexMap);
    }

    private TreeNode buildTree(int[] preorder, int[] postorder, int preStart, int preEnd, int postStart, int postEnd, HashMap<Integer, Integer> postorderIndexMap) {
        if (preStart > preEnd) {
            return null;
        }

        int rootVal = preorder[preStart];
        TreeNode root = new TreeNode(rootVal);

        if (preStart == preEnd) {
            return root;
        }

        int leftPostorderIndex = postorderIndexMap.get(preorder[preStart + 1]);
        int leftPreorderEnd = preStart + 1;
        while (leftPreorderEnd < preorder.length && preorder[leftPreorderEnd] != preorder[leftPostorderIndex]) {
            leftPreorderEnd++;
        }

        root.left = buildTree(preorder, postorder, preStart + 1, leftPreorderEnd, postStart, leftPostorderIndex, postorderIndexMap);
        root.right = buildTree(preorder, postorder, leftPreorderEnd + 1, preEnd, leftPostorderIndex + 1, postEnd, postorderIndexMap);

        return root;
    }
}

