public class Solution {
    public double mincostToHireWorkers(int[] quality, int[] wage, int k) {
        int n = quality.length;
        double[][] workers = new double[n][3];
        for (int i = 0; i < n; i++) {
            workers[i][0] = (double) wage[i] / quality[i];
            workers[i][1] = quality[i];
            workers[i][2] = wage[i];
        }
        Arrays.sort(workers, Comparator.comparingDouble(a -> a[0]));
        PriorityQueue<Double> pq = new PriorityQueue<>(Comparator.reverseOrder());
        double totalQuality = 0;
        double minCost = Double.MAX_VALUE;
        for (int i = 0; i < n; i++) {
            totalQuality += workers[i][1];
            pq.offer(workers[i][1]);
            if (pq.size() > k) {
                totalQuality -= pq.poll();
            }
            if (pq.size() == k) {
                double ratio = workers[i][0];
                minCost = Math.min(minCost, ratio * totalQuality);
            }
        }
        return minCost;
    }
}

