import java.util.ArrayDeque;
import java.util.Objects;
import java.util.Queue;
public class Solution {
    public int shortestPathLength(int[][] graph) {
        int n = graph.length;
        if (n == 1) {
            return 0;
        }

        Queue<int[]> queue = new ArrayDeque<>();
        int[][] dist = new int[1 << n][n];
        for (int i = 0; i < (1 << n); i++) {
            for (int j = 0; j < n; j++) {
                dist[i][j] = Integer.MAX_VALUE;
            }
        }

        for (int i = 0; i < n; i++) {
            dist[1 << i][i] = 0;
            queue.offer(new int[]{1 << i, i});
        }

        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int mask = curr[0];
            int node = curr[1];

            for (int neighbor : graph[node]) {
                int newMask = mask | (1 << neighbor);
                if (dist[newMask][neighbor] > dist[mask][node] + 1) {
                    dist[newMask][neighbor] = dist[mask][node] + 1;
                    queue.offer(new int[]{newMask, neighbor});
                }
            }
        }

        int minLen = Integer.MAX_VALUE;
        for (int i = 0; i < n; i++) {
            minLen = Math.min(minLen, dist[(1 << n) - 1][i]);
        }

        return minLen;
    }
}

