public class Solution {
    public int sumSubseqWidths(int[] nums) {
        Arrays.sort(nums);
        int n = nums.length;
        long sum = 0;
        long mod = 1000000007;
        long powerOf2 = 1;
        for (int i = 0; i < n; i++) {
            sum = (sum + (nums[i] * powerOf2) % mod) % mod;
            powerOf2 = (powerOf2 * 2) % mod;
