    public int reachableNodes(int[][] edges, int maxMoves, int n) {
        List<List<int[]>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }

        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            int cnt = edge[2];

            adj.get(u).add(new int[]{v, cnt + 1});
            adj.get(v).add(new int[]{u, cnt + 1});
        }

        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[0] = 0;

        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[0] - b[0]);
        pq.offer(new int[]{0, 0});

        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            int u = curr[0];
            int d = curr[1];

            if (d > dist[u]) {
                continue;
            }

            for (int[] neighbor : adj.get(u)) {
                int v = neighbor[0];
                int weight = neighbor[1];

                if (dist[u] + weight < dist[v]) {
                    dist[v] = dist[u] + weight;
                    pq.offer(new int[]{v, dist[v]});
                }
            }
        }

        int reachableNodes = 0;
        for (int i = 0; i < n; i++) {
            if (dist[i] <= maxMoves) {
                reachableNodes++;
            }
        }

        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            int cnt = edge[2];

            int reachableFromU = (dist[u] <= maxMoves) ? maxMoves - dist[u] : 0;
            int reachableFromV = (dist[v] <= maxMoves) ? maxMoves - dist[v] : 0;

            int reachableEdges = Math.min(cnt, Math.max(0, reachableFromU + reachableFromV));
            reachableNodes += reachableEdges;
        }

        return reachableNodes;
    }
}

