import java.util.HashMap;
import java.util.Map;
import java.util.TreeSet;
public class Solution {
    public int robotSim(int[] commands, int[][] obstacles) {
        int x = 0;
        int y = 0;
        int direction = 0; // 0: East, 1: North, 2: West, 3: South
        int maxDistanceSq = 0;

        Map<String, Boolean> obstacleMap = new HashMap<>();
        for (int[] obstacle : obstacles) {
            obstacleMap.put(obstacle[0] + "," + obstacle[1], true);
        }

        for (int command : commands) {
            if (command == -2) {
                direction = (direction + 3) % 4; // Turn left
            } else if (command == -1) {
                direction = (direction + 1) % 4; // Turn right
            } else {
                for (int i = 0; i < command; i++) {
                    int nextX = x;
                    int nextY = y;

                    if (direction == 0) {
                        nextX++;
                    } else if (direction == 1) {
                        nextY++;
                    } else if (direction == 2) {
                        nextX--;
                    } else {
                        nextY--;
                    }

                    if (obstacleMap.containsKey(nextX + "," + nextY)) {
                        break; // Obstacle encountered, stop moving
                    }

                    x = nextX;
                    y = nextY;
                    maxDistanceSq = Math.max(maxDistanceSq, x * x + y * y);
                }
            }
        }

        return maxDistanceSq;
    }
}

