import java.util.HashSet;
import java.util.Set;
public class Solution {
    public int numMagicSquaresInside(int[][] grid) {
        int rows = grid.length;
        int cols = grid[0].length;
        int count = 0;

        if (rows < 3 || cols < 3) {
            return 0;
        }

        for (int i = 0; i <= rows - 3; i++) {
            for (int j = 0; j <= cols - 3; j++) {
                if (isMagicSquare(grid, i, j)) {
                    count++;
                }
            }
        }

        return count;
    }

    private boolean isMagicSquare(int[][] grid, int rowStart, int colStart) {
        Set<Integer> numbers = new HashSet<>();
        int sum = 0;

        // Calculate sum of first row
        for (int i = colStart; i < colStart + 3; i++) {
            int num = grid[rowStart][i];
            if (num < 1 || num > 9 || !numbers.add(num)) {
                return false;
            }
            sum += num;
        }

        // Check rows
        for (int i = rowStart + 1; i < rowStart + 3; i++) {
            int rowSum = 0;
            for (int j = colStart; j < colStart + 3; j++) {
                int num = grid[i][j];
                if (num < 1 || num > 9 || !numbers.add(num)) {
                    return false;
                }
                rowSum += num;
            }
            if (rowSum != sum) {
                return false;
            }
        }

        // Check columns
        for (int j = colStart; j < colStart + 3; j++) {
            int colSum = 0;
            for (int i = rowStart; i < rowStart + 3; i++) {
                int num = grid[i][j];
                colSum += num;
            }
            if (colSum != sum) {
                return false;
            }
        }

        // Check diagonals
        int diag1Sum = grid[rowStart][colStart] + grid[rowStart + 1][colStart + 1] + grid[rowStart + 2][colStart + 2];
        int diag2Sum = grid[rowStart][colStart + 2] + grid[rowStart + 1][colStart + 1] + grid[rowStart + 2][colStart];

        if (diag1Sum != sum || diag2Sum != sum) {
            return false;
        }

        return true;
    }
}

