// #Hard #Array #Depth_First_Search #Breadth_First_Search #Matrix #Union_Find
// #2022_03_24_Time_147_ms_(74.37%)_Space_132.4_MB_(56.88%)
import java.util.HashMap;
public class Solution {
    public int largestIsland(int[][] grid) {
        int n = grid.length;
        int islandId = 2;
        HashMap<Integer, Integer> islandSize = new HashMap<>();
        islandSize.put(0, 0);
        int maxIsland = 0;

        // DFS to find all islands and their sizes
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    int size = dfs(grid, i, j, islandId);
                    islandSize.put(islandId, size);
                    maxIsland = Math.max(maxIsland, size);
                    islandId++;
                }
            }
        }

        // Check each 0 and try to connect adjacent islands
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) {
                    HashMap<Integer, Boolean> visited = new HashMap<>();
                    int newIslandSize = 1;
                    // Check adjacent cells
                    int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
                    for (int[] dir : directions) {
                        int newRow = i + dir[0];
                        int newCol = j + dir[1];
                        if (newRow >= 0 && newRow < n && newCol >= 0 && newCol < n && grid[newRow][newCol] != 0) {
                            int island = grid[newRow][newCol];
                            if (!visited.containsKey(island)) {
                                newIslandSize += islandSize.get(island);
                                visited.put(island, true);
                            }
                        }
                    }
                    maxIsland = Math.max(maxIsland, newIslandSize);
                }
            }
        }

        return maxIsland;
    }

    private int dfs(int[][] grid, int row, int col, int islandId) {
        int n = grid.length;
        if (row < 0 || row >= n || col < 0 || col >= n || grid[row][col] != 1) {
            return 0;
        }

        grid[row][col] = islandId;
        int size = 1;
        size += dfs(grid, row + 1, col, islandId);
        size += dfs(grid, row - 1, col, islandId);
        size += dfs(grid, row, col + 1, islandId);
        size += dfs(grid, row, col - 1, islandId);

        return size;
    }
}

