public class Solution {
    public double soupServings(int n) {
        if (n >= 400) {
            return 1.0;
        }
        double[][] dp = new double[n + 1][n + 1];
        for (int i = 0; i <= n; i++) {
            for (int j = 0; j <= n; j++) {
                dp[i][j] = -1.0;
            }
        }
        return solve(n, n, dp);
    }

    private double solve(int a, int b, double[][] dp) {
        if (a <= 0 && b <= 0) {
            return 0.5;
        }
        if (a <= 0) {
            return 1.0;
        }
        if (b <= 0) {
            return 0.0;
        }
        if (dp[a][b] != -1.0) {
            return dp[a][b];
        }

        double prob = 0.0;
        // Serve 100 ml of soup A and 0 ml of soup B
        if (a >= 100) {
            prob += 0.25 * solve(a - 100, b, dp);
        } else {
            prob += 0.25 * solve(0, b, dp);
        }

        // Serve 75 ml of soup A and 25 ml of soup B
        if (a >= 75 && b >= 25) {
            prob += 0.25 * solve(a - 75, b - 25, dp);
        } else if (a >= 0 && b >= 0) {
            if (a >= 0 && b >= 0) {
                int serveA = Math.min(a, 75);
                int serveB = Math.min(b, 25);
                prob += 0.25 * solve(a - serveA, b - serveB, dp);
            }
        }

        // Serve 50 ml of soup A and 50 ml of soup B
        if (a >= 50 && b >= 50) {
            prob += 0.25 * solve(a - 50, b - 50, dp);
        } else if (a >= 0 && b >= 0) {
            int serveA = Math.min(a, 50);
            int serveB = Math.min(b, 50);
            prob += 0.25 * solve(a - serveA, b - serveB, dp);
        }

        // Serve 25 ml of soup A and 75 ml of soup B
        if (a >= 25 && b >= 75) {
            prob += 0.25 * solve(a - 25, b - 75, dp);
        } else if (a >= 0 && b >= 0) {
            int serveA = Math.min(a, 25);
            int serveB = Math.min(b, 75);
            prob += 0.25 * solve(a - serveA, b - serveB, dp);
        }

        dp[a][b] = prob;
        return prob;
    }
}

