                left[i] = left[i - 1] + 1;
            } else {
                left[i] = 0;
            }
        }

        right[n - 1] = 0;
        for (int i = n - 2; i >= 0; i--) {
            if (arr[i] > arr[i + 1]) {
                right[i] = right[i + 1] + 1;
            } else {
                right[i] = 0;
            }
        }

        for (int i = 0; i < n; i++) {
            if (left[i] > 0 && right[i] > 0) {
                longest = Math.max(longest, left[i] + right[i] + 1);
            }
        }

        return longest;
    }
}

