        int n = s.length();
        for (int i = 1; i < n - 1; i++) {
            String left = s.substring(1, i);
            String right = s.substring(i, n - 1);
            List<String> leftList = generatePossibilities(left);
            List<String> rightList = generatePossibilities(right);
