import java.util.Arrays;

public class Solution {
    public int[] hitBricks(int[][] grid, int[][] hits) {
        int m = grid.length;
        int n = grid[0].length;
        int[] result = new int[hits.length];
        int[][] tempGrid = new int[m][n];
        for (int i = 0; i < m; i++) {
            tempGrid[i] = Arrays.copyOf(grid[i], n);
        }

        for (int i = 0; i < hits.length; i++) {
            int row = hits[i][0];
            int col = hits[i][1];
            if (tempGrid[row][col] == 1) {
                tempGrid[row][col] = 0;
                result[i] = countFallingBricks(tempGrid);
            } else {
                result[i] = 0;
            }
        }

        return result;
    }

    private int countFallingBricks(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        int count = 0;
        boolean[][] visited = new boolean[m][n];

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1 && !visited[i][j]) {
                    if (!isStable(grid, i, j, visited)) {
                        count++;
                    }
                }
            }
        }

        return count;
    }

    private boolean isStable(int[][] grid, int row, int col, boolean[][] visited) {
        int m = grid.length;
        int n = grid[0].length;

        if (row == 0) {
            return true;
        }

        visited[row][col] = true;

        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

        for (int[] dir : directions) {
            int newRow = row + dir[0];
            int newCol = col + dir[1];

            if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n && grid[newRow][newCol] == 1) {
                if (newRow == 0 || isStable(grid, newRow, newCol, visited)) {
                    return true;
                }
            }
        }

        return false;
    }
}

