import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.List;

public class Solution {
    public TreeNode subtreeWithAllDeepest(TreeNode root) {
        List<TreeNode> deepestNodes = new ArrayList<>();
        int maxDepth = maxDepth(root, deepestNodes);
        return findSubtree(root, deepestNodes);
    }

    private int maxDepth(TreeNode node, List<TreeNode> deepestNodes) {
        if (node == null) {
            return 0;
        }

        int leftDepth = maxDepth(node.left, deepestNodes);
        int rightDepth = maxDepth(node.right, deepestNodes);

        int depth = Math.max(leftDepth, rightDepth) + 1;

        if (depth > deepestNodes.size()) {
            deepestNodes.clear();
            deepestNodes.add(node);
        } else if (depth == deepestNodes.size()) {
            deepestNodes.add(node);
        }

        return depth;
    }

    private TreeNode findSubtree(TreeNode root, List<TreeNode> deepestNodes) {
        if (root == null) {
            return null;
        }

        if (deepestNodes.contains(root)) {
            return root;
        }

        TreeNode leftSubtree = findSubtree(root.left, deepestNodes);
        TreeNode rightSubtree = findSubtree(root.right, deepestNodes);

        if (leftSubtree != null) {
            return leftSubtree;
        } else if (rightSubtree != null) {
            return rightSubtree;
        } else {
            return null;
        }
    }
}

