import java.util.ArrayList;
import java.util.List;

// #Medium #Array #String #Two_Pointers #2022_03_23_Time_2_ms_(86.09%)_Space_42.9_MB_(22.41%)
public class Solution {
    public int expressiveWords(String s, String[] words) {
        List<int[]> groups = getGroups(s);
        int count = 0;
        for (String word : words) {
            List<int[]> wordGroups = getGroups(word);
            if (wordGroups.size() != groups.size()) {
                continue;
            }
            boolean stretchy = true;
            for (int i = 0; i < groups.size(); i++) {
                int[] sGroup = groups.get(i);
                int[] wordGroup = wordGroups.get(i);
                if (sGroup[0] != wordGroup[0]) {
                    stretchy = false;
                    break;
                }
                if (sGroup[1] < wordGroup[1]) {
                    stretchy = false;
                    break;
                }
            }
            if (stretchy) {
                count++;
            }
        }
        return count;
    }

    private List<int[]> getGroups(String s) {
        List<int[]> groups = new ArrayList<>();
        int i = 0;
        while (i < s.length()) {
            char c = s.charAt(i);
            int j = i;
            while (j < s.length() && s.charAt(j) == c) {
                j++;
            }
            groups.add(new int[]{c, j - i});
            i = j;
        }
        return groups;
    }
}

